import React, { useEffect, useState } from 'react'
import {
    Box,
    Icon,
    IconButton,
    styled,
    Table,
    TableBody,
    TableCell,
    TableHead,
    TableRow,
} from "@mui/material";
import { Breadcrumb, SimpleCard } from "app/components";
import { getExams } from "app/Api/apis";


const Container = styled("div")(({ theme }) => ({
    margin: "30px",
    [theme.breakpoints.down("sm")]: { margin: "16px" },
    "& .breadcrumb": {
        marginBottom: "30px",
        [theme.breakpoints.down("sm")]: { marginBottom: "16px" },
    },
}));

const StyledTable = styled(Table)(({ theme }) => ({
    whiteSpace: "pre",
    "& thead": {
        "& tr": { "& th": { paddingLeft: 0, paddingRight: 0 } },
    },
    "& tbody": {
        "& tr": { "& td": { paddingLeft: 0, textTransform: "capitalize" } },
    },
}));


    const ExamList = () => {
    const [state, setState] = useState([])

    useEffect(async ()=> {
        const users = await getList()
        setState(users.data)
    }, [])

    return (
        <Container>
            <SimpleCard>
                <Box width="100%" overflow="auto">
                    <StyledTable>
                        <TableHead>
                            <TableRow>
                                <TableCell align="left">Id</TableCell>
                                <TableCell align="left">Name</TableCell>
                                <TableCell align="center">Email</TableCell>
                                <TableCell align="center">User Name</TableCell>
                                <TableCell align="center">Contact Number</TableCell>
                                <TableCell align="right">Action</TableCell>
                            </TableRow>
                        </TableHead>

                        <TableBody>
                            {state.map((subscriber, index) => (
                                <TableRow key={index}>
                                <TableCell align="left">{index + 1}</TableCell>
                                    <TableCell align="left">{subscriber.full_name}</TableCell>
                                    <TableCell align="center">{subscriber.email}</TableCell>
                                    <TableCell align="center">{subscriber.user_name}</TableCell>
                                    <TableCell align="center">{subscriber.contact_number}</TableCell>
                                    <TableCell align="center">
                                    Edit / Delete
                                    </TableCell>
                                    <TableCell align="right">

                                    </TableCell>
                                </TableRow>
                            ))}
                        </TableBody>
                    </StyledTable>
                </Box>
            </SimpleCard>
        </Container>
    );
};

export default ExamList;
